import React from 'react';
import { Container } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
import './footer.css'; 

const Footer = () => {
  return (
    <footer className="footer">
  <p>&copy; 2024 Tharushika Navodi. All Rights Reserved.</p>
  <ul className="footer-links">
    <li><a href="/" target="_self">Home</a></li>
    <li><a href="/about" target="_self">About</a></li>
    <li><a href="/project" target="_self">Projects</a></li>
    <li><a href="/contact" target="_self">Contact</a></li>
  </ul>
  <div className="social-links">
    <a href="mailto:tharushikanavodi28@gmail.com" target="_blank" rel="noopener noreferrer">
      <i className="fas fa-envelope"></i>
    </a>
    <a href="https://github.com/IT20639662" target="_blank" rel="noopener noreferrer">
      <i className="fab fa-github"></i>
    </a>
    <a href="http://www.linkedin.com/in/tharushika-n-859a77249" target="_blank" rel="noopener noreferrer">
      <i className="fab fa-linkedin"></i>
    </a>
  </div>
</footer>

  );
};

export default Footer;
